/**
 * Superclasse di tutti i controller delle pagine che si aprono con modale
 */
class BaseModaleCtrl {
	constructor(idDialog, nomePagina, idScriptHandlebars){
		closeNav();
		this.idDialog = idDialog;
		this.nomePagina = nomePagina;
		this.idScriptHandlebars = idScriptHandlebars;
		this.datatableLan = {
			"sEmptyTable":     "Nessun dato presente nella tabella",
			"sInfo":           "Mostrati da _START_ a _END_ di _TOTAL_ elementi",
			"sInfoEmpty":      "Nessun dato presente",
			"sInfoFiltered":   "(filtrati da _MAX_ elementi totali)",
			"sInfoPostFix":    "",
			"sInfoThousands":  ".",
			"sLengthMenu":     "Elementi per pagina _MENU_",
			"sLoadingRecords": "Caricamento...",
			"sProcessing":     "Elaborazione...",
			"sSearch":         " Cerca ",
			"sSearchPlaceholder": "Ricerca...",
			"sZeroRecords":    "La ricerca non ha portato alcun risultato.",
			"oPaginate": {
				"sFirst":      "Inizio",
				"sPrevious":   "<",
				"sNext":       ">",
				"sLast":       "Fine"
			},
			"select": {
				"rows": {
					_: "%d righe selezionate",
					0: "",
					1: "1 riga selezionata"
				}
			},
			"oAria": {
				"sSortAscending":  ": attiva per ordinare la colonna in ordine crescente",
				"sSortDescending": ": attiva per ordinare la colonna in ordine decrescente"
			}
		};
		this.datatableButtons = [
            {
                extend:    'excelHtml5',
                text:      '<em class="fa fa-file-excel-o"></em> Esporta in XLS',
                titleAttr: 'Excel',
                className: 'btn-trasp bttn'
            }
        ];
		this.datatableDom = 'Bfrtip'; 
		this.base64PdfVisuraCatastale = '';
		this.base64PdfVuoto = '';
		$.datepicker.regional['it'] = {
			closeText: 'Chiudi',
			currentText: 'Oggi',
			monthNames: ['Gennaio', 'Febbraio', 'Marzo', 'Aprile', 'Maggio', 'Giugno', 'Luglio', 'Agosto', 'Settembre', 'Ottobre', 'Novembre', 'Dicembre'],
			monthNamesShort: ['Gen', 'Feb', 'Mar', 'Apr', 'Mag', 'Giu', 'Lug', 'Ago', 'Set', 'Ott', 'Nov', 'Dic'],
			dayNames: ['Domenica', 'Luned&#236', 'Marted&#236', 'Mercoled&#236', 'Gioved&#236', 'Venerd&#236', 'Sabato'],
			dayNamesShort: ['Dom', 'Lun', 'Mar', 'Mer', 'Gio', 'Ven', 'Sab'],
			dayNamesMin: ['Do', 'Lu', 'Ma', 'Me', 'Gio', 'Ve', 'Sa'],
			dateFormat: 'dd/mm/yy'
		}
		$.datepicker.setDefaults($.datepicker.regional['it']);
	}
	/**
	 * Effettua il download di un file PDF vuoto
	 */
	downloadFilePdfVuoto(nomeFile){
		const linkSource = 'data:application/pdf;base64,'+self.base64PdfVuoto;
	    const downloadLink = document.createElement('a');
	    downloadLink.href = linkSource;
	    downloadLink.download = nomeFile;
	    downloadLink.click();
	}
	/**
	 * Metodo per generare un intero randomico tra un minimo ed un massimo valore.
	 */
	randomInt(min, max) {
	    min = Math.ceil(min);
	    max = Math.floor(max);
	    return Math.floor(Math.random() * (max - min + 1)) + min;
	}
	/**
	 * Metodo che riduce ad icona tutte le modali aperte.
	 */
	riduciAdIconaTutteLeModali(){
		$('.modale-messina').find('div.innerleftMapsize.ui-dialog-content.ui-widget-content').each( function(){ 
			let id = $(this).attr('id');
			if( !$("#"+id).hasClass("hidden") ) 
				minifize($(this).attr('id')); 
		});
	}
	/**
	 * Metodo che aggiunge un evento per la chisurura della finestra al click sul pulsante chiudi
	 */
	aggiungiEventoClickChiudiFinestra(){
		var self = this;
		$('#'+self.idDialog+' #chiudiBtn').on('click', function(){
			//chiude la modale
			drawLayerSource.clear();
			$('#'+self.idDialog).dialog('close');
			var oldSelezionati = JSON.parse(sessionStorage.getItem('layerSelezionati'));
			if (oldSelezionati !== null && oldSelezionati.length > 0) {
				for(var i in appUrbamid.layerMap) {
					let layer = appUrbamid.layerMap[i];
					if(layer.I.isBaseLayer != true && layer.I.variante) {
						$('#' + i + '_chk').click();
					}
				}
				sessionStorage.removeItem('layerSelezionati');
				$("#boxVisualizzatoreMappa .panel-group:last-child").last()[0].remove()
			}
		});
	}
	/**
	 * Metodo che inizializza il breadcrumb (al momento serve solo per impostare che al click sul primo elemento del 
	 * breadcrumb si viene rediretti alla homepage e sul secondo alla home di catasto [ovvero chiudo tutte le modali]).
	 */
	inizializzaBreadcrumb(){
		var self = this;
		$('#'+this.idDialog+' ul.breadcrumb li:nth-child(1) a').off('click').on('click', function(event){
			if(event) event.preventDefault();
			self.vaiAllaHomepage();
		});
		$('#'+this.idDialog+' ul.breadcrumb li:nth-child(2) a').off('click').on('click', function(event){
			if(event) event.preventDefault();
			self.chiudiTutteLeFinestre();
		});
	}
	/**
	 * Metodo che serve per ritornare alla homepage
	 */
	vaiAllaHomepage(){
		window.location = appConfig.urbamidService;
	}
	/**
	 * Metodo che chiude tutte le modale attualmente aperte
	 */
	chiudiTutteLeFinestre(){
		$('.modale-messina').find('div.innerleftMapsize.ui-dialog-content.ui-widget-content').each( function(){ 
			let id = $(this).attr('id');
			$('#'+id).dialog('destroy').remove();
		});
	}
}

